const Header = () => {
  const imgUrl =
    "https://assets.stickpng.com/images/612ce4761b9679000402af1c.png";
  return (
    <h1 style={{ fontSize: "48px" }}>
      Who's that Pokemon?
      <span
        style={{
          height: "48px",
          width: "48px",
          backgroundImage: `url(${imgUrl})`,
        }}
      >
        <img src={imgUrl} />
      </span>
    </h1>
  );
};

export default Header;
